import {
  Grid,
  Button,
  Container,
  TextField,
  Stack,
  FormGroup,
  FormControlLabel,
  Checkbox
} from "@mui/material"

import {
  LoadingButton
} from "@mui/lab";
const Forgot = ()=>{
  const design = (
    <>
    <Container sx={{m:4}}>
      <Grid container>
        <Grid item xs={12} sm={6}>One</Grid>
        <Grid item xs={12} sm={6}>
         <h1>Forgot Password</h1>
         <form>
            <TextField
                name="email"
                label="Email id"
                variant="outlined"
            />
            <LoadingButton>Forgot</LoadingButton>
         </form>

        </Grid>
      </Grid>
    </Container>
    </>
  );
  return design;
}
export default Forgot;
